#include <stdio.h>
#include <stdlib.h>

int* twoSum(int* nums, int numsSize, int target, int* returnSize){
    int *result = (int *)malloc(sizeof(int)*2);

    for(int i = 0; i < numsSize; i++){
        for(int j = i + 1; j < numsSize; j++){
            if(nums[i] + nums[j] == target){
                result[0] = i;
                result[1] = j;
                *returnSize = 2;
                return result;
            }
        }
    }
    *returnSize = 0;
    return NULL;
}

int main() {
    int nums[] = {2, 7, 11, 15};
    int target = 9;
    int returnSize = 0;
    int *result = twoSum(nums, 4, target, &returnSize);

    if(returnSize == 2){
        printf("[%d, %d]\n", result[0], result[1]);
    } else {
        printf("No solution found\n");
    }

    return 0;
}
```

Aur kaise ho saare this is naman here! chalo bhai log samajte hai ki two sum problem kya hota hai...

Yahan ek array hota hai aur do numbers dene hote hai, toh humein array me aise two numbers find karne hote hai jinke sum se given number banta ho.

Chalo ek example lete hai:

array = [2, 7, 11, 15], target = 9

is array me humein 2 aur 7 find karne hai jinke sum se 9 banta hai.

Toh is problem ko solve karne ke liye hum hashing technique use karte hai.

1. Ek hash table banayenge, jisme key array ka element hoga aur value key ka index hoga.
2. Ab array ko ek-एक करके iterate karenge.
3. Har element ke liye, target minus element ki value check karenge.
4. Agar target minus element hash table me hai, matlab ki humne two numbers find kar liye hai.
5. Un numbers ke index return karenge.

Chalo code implement karte hai:

```c
#include <stdio.h>
#include <stdlib.h>

int* twoSum(int* nums, int numsSize, int target, int* returnSize) {
    int *result = (int *)malloc(2 * sizeof(int));
    *returnSize = 2;
    int *hashtable = (int *)malloc(sizeof(int) * numsSize);
    for (int i = 0; i < numsSize; i++) {
        hashtable[i] = -1;
    }
    for (int i = 0; i < numsSize; i++) {
        int complement = target - nums[i];
        if (hashtable[complement] != -1) {
            result[0] = hashtable[complement];
            result[1] = i;
            return result;
        }
        hashtable[nums[i]] = i;
    }
    return NULL;
}

int main() {
    int nums[] = {2, 7, 11, 15};
    int target = 9;
    int returnSize;
    int *result = twoSum(nums, 4, target, &returnSize);
    printf("Indices that add up to %d are: %d and %d\n", target, result[0], result[1]);
    free(result);
    return 0;
}
```

