To create a time table using CSS and HTML, follow these steps:

**HTML:**

```html
<table>
  <caption>Time Table</caption>
  <thead>
    <tr>
      <th>Day</th>
      <th>Subject</th>
      <th>Time</th>
    </tr>
  </thead>
  <tbody>
