class Palin {
    static void checkPalindrome(String s) {
        int n = s.length();
        boolean flag = True;
        for(int i=0; i<n/2; i++) {
            char ch1 = s.charAt(i);
            char ch2 = s.charAt(n-i-1);
            if(ch1!=ch2) {
                flag = False;
            }
        }
        if(flag == False) {
            System.out.print("False");
        }
        else {
            System.out.printn("True");
        }
    }
}

