import java.util.Arrays;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String str = sc.next();
        char[] arr = str.toCharArray();

        char[] reversedArr = Arrays.copyOf(arr, arr.length);
        Arrays.sort(reversedArr);
        
        for (int i = 0, j = reversedArr.length - 1; i < j; i++, j--) {
            char temp = reversedArr[i];
            reversedArr[i] = reversedArr[j];
            reversedArr[j] = temp;
        }

        if (Arrays.equals(arr, reversedArr)) {
            System.out.println("True");
        } else {
            System.out.println("False");
        }
    }
}

