#include <iostream>
using namespace std;

int main() {
	int n;
	cin>>n;
	int dig=0;
	int temp=n;
	while(temp>0){
	    dig+=1;
	    temp=/10;
	}
	temp=n;
	int sum=0;
	while(temp>0){
	    sum+=pow(temp%10,dig);
	    temp/=10;
	}
	if(n==sum){
	    cout<<"Armstrong Number";
	}
	else{
	    cout<<"Not an Armstrong Number";
	}
	return 0;
}

