    	int temp=n;
    	while(temp>0){
    	    dig+=1;
    	    temp=/10;
    	}
    	temp=n;
    	int sum=0;
    	while(temp>0){
    	    sum+=pow(temp%10,dig);
    	    temp/=10;
    	}
