import java.util.*;

public class Main {
    public static void main(String[] args) {
        // Create a scanner to read the input string
        Scanner r = new Scanner(System.in);
        String s = r.nextLine();  // Read the entire line of input
        int l = s.length();  // Get the length of the input string
        LinkedHashMap<Character, Integer> map = new LinkedHashMap<>();  // Use LinkedHashMap to preserve the order
        
        // Iterate over the string to count frequencies
        for (int i = 0; i < l; i++) {
            char ch = s.charAt(i);
            // Convert to lowercase and check if the character is a letter or digit
            if (Character.isLetterOrDigit(ch)) {
                ch = Character.toLowerCase(ch);  // Convert character to lowercase
                map.put(ch, map.getOrDefault(ch, 0) + 1);  // Update the frequency
            }
        }

        // Printing the map in the desired format
        System.out.print("{");
        boolean first = true;  // To manage commas between entries
        for (Map.Entry<Character, Integer> entry : map.entrySet()) {
            if (!first) {
                System.out.print(", ");
            }
            first = false;
            System.out.print("'" + entry.getKey() + "': " + entry.getValue());
        }
        System.out.println("}");
    }
}

