public class CommaSeparatedLists {

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        // Taking input for the first list
        System.out.print("Enter the first list (e.g., [29,38,38,83,93]): ");
        String input1 = scanner.nextLine();

        // Taking input for the second list
        System.out.print("Enter the second list (e.g., [38,38,39,98,87]): ");
        String input2 = scanner.nextLine();

        // Process the input lists
        int[] list1 = parseInput(input1);
        int[] list2 = parseInput(input2);

        // Display the sums of the lists
        System.out.println("Sum of the first list: " + sumArray(list1));
        System.out.println("Sum of the second list: " + sumArray(list2));

        scanner.close();
    }

    // Method to parse the input string into an integer array
    private static int[] parseInput(String input) {
        // Remove the brackets and split the string by commas
        String cleanedInput = input.replaceAll("[\\[\\] ]", "");
        String[] stringNumbers = cleanedInput.split(",");

        // Convert the string array to an integer array
        int[] numbers = new int[stringNumbers.length];
        for (int i = 0; i < stringNumbers.length; i++) {
            numbers[i] = Integer.parseInt(stringNumbers[i]);
        }

        return numbers;
    }

    // Method to calculate the sum of an integer array
    private static int sumArray(int[] array) {
        int sum = 0;
        for (int num : array) {
            sum += num;
        }
        return sum;
    }
}

