class Solution{
    
    //Function to return sum of count of set bits in the integers from 1 to n.
    public static int countSetBits(int n){
    
        
        int count = 0;
        
        while(n>0){
           count++;
           n = n & (n - 1);
        }
        return count;
        
    }
}

