// User function Template for Java
class Solution {
    public ArrayList<Integer> firstAndLast(int x, int arr[]) {
        // Code here
        
        ArrayList<Integer> list = new ArrayList<>();
        int first=-1;
        int last=-1;
        for(int i=0;i<arr.length;i++){
            if(arr[i]==x){
                first=i;
                break;
            }
        }
        for(int i=0;i<arr.length;i++){
            if(arr[i]==x){
                last=i;
            }
        }
        if(first==-1){
            list.add(-1);
        }
        else{
            list.add(first);
            list.add(last);
        }
        return list;
    }

}
